import {
  Avatar,
  Button,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import { Box } from "@mui/system";
import axios from "axios";
import React, { useEffect } from "react";
import SocialMedia from "../../common/SocialMedia";

const styles = {
  relativeCardStyle: {
    position: "relative",
    background:
      "linear-gradient(0deg, rgba(255,253,249,1) 63%, rgba(34,193,195,1) 47%)",
  },
  formBoxStyle: {
    position: "absolute",
    top: "30%",
    left: "50%",
    transform: "translate(-50%, -30%)",
    bgcolor: "background.paper",
    boxShadow: "24",
    p: 4,
    backgroundColor: "rgba(255, 255, 255)",
    backdropFilter: "blur(5px)",
  },
};
const Labels = () => {
  const [labelInfo, setLabelInfo] = useState([]);

  useEffect(async () => {
    const res = await axios.get("/promoter/blogs/all");
    setLabelInfo(res.data);
  }, []);
  return (
    <Card
      sx={{ maxWidth: 300, height: "250px" }}
      style={styles.relativeCardStyle}
    >
      <Typography height="100px">labelInfo.name</Typography>
      <Box style={styles.formBoxStyle}>
        <Avatar>Avatar</Avatar>
      </Box>
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Label Owner
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        {currChannel.sociallinks.map((socialaccount, i) => (
          <SocialMedia
            socialaccount={socialaccount}
            i={i}
            size={2}
          ></SocialMedia>
        ))}
      </CardActions>
    </Card>
  );
};

export default Labels;
